import React from 'react';

const Rankings = ({players}) => {
    return (
        <div className="main"> 
            {players.map((player) => (
                <div className="row"> 
                    <div className="col">
                        <p>{player.id}</p>
                    </div>
                    <div className="col">
                        <p>{player.name}</p>
                    </div>
                </div>
            ))}
        </div>
    )
}

export default Rankings
